import React from "react";
import Todo from "./Todo";

const TodoList = ({todos, completedOrNot, removeItem}) => {
    return(
        <div className = "todo-container">
            <ul className = "todo-list">
                {todos.map(todo => (
                    <Todo 
                        key={todo.id}
                        todo= {todo}
                        completedOrNot={completedOrNot}

                    />
                ))}
                
            </ul>
        </div>
    );
};

export default TodoList;
